{
    "typeName": "SvectorDB::VectorDatabase::Database",
    "description": "Creates a serverless vector database with SvectorDB, sign up at https://svectordb.com to get started",
    "definitions": {
    },
    "properties": {
        "EndpointUrl": {
            "type": "string",
            "description": "(Advanced use cases only) - Custom endpoint URL for contacting the SvectorDB API"
        },
        "IntegrationId": {
            "type": "string",
            "description": "Integration ID"
        },
        "Id": {
            "type": "string",
            "description": "Database ID"
        },
        "Name": {
            "type": "string",
            "description": "Name that appears in the SvectorDB console",
            "minLength": 1,
            "maxLength": 256,
            "pattern": "^[A-Za-z0-9 -_]+$"
        },
        "Type": {
            "type": "string",
            "enum": [
                "SANDBOX",
                "STANDARD"
            ]
        },
        "Metric": {
            "type": "string",
            "enum": [
                "EUCLIDEAN",
                "DOT_PRODUCT",
                "COSINE"
            ]
        },
        "Dimension": {
            "type": "integer",
            "minimum": 1,
            "maximum": 1024
        }
    },
    "additionalProperties": false,
    "required": [
        "IntegrationId",
        "Metric",
        "Dimension"
    ],
    "createOnlyProperties": [
        "/properties/EndpointUrl",
        "/properties/IntegrationId",
        "/properties/Type",
        "/properties/Metric",
        "/properties/Dimension"
    ],
    "readOnlyProperties": [
        "/properties/Id"
    ],
    "primaryIdentifier": [
        "/properties/Id"
    ],
    "handlers": {
        "create": {
            "permissions": []
        },
        "read": {
            "permissions": []
        },
        "update": {
            "permissions": []
        },
        "delete": {
            "permissions": []
        },
        "list": {
            "permissions": []
        }
    }
}
